import { Component } from '@angular/core';
import {FormControl, FormGroup, Validators} from '@angular/forms'
import {Router} from "@angular/router";
import {AuthService} from "../../services/auth.service";
import { SocialAuthService } from "angularx-social-login";
import { GoogleLoginProvider } from "angularx-social-login";
import { SocialUser } from "angularx-social-login";


@Component({
  selector: 'app-signup-page',
  templateUrl: './signup-page.component.html',
  styleUrls: ['./signup-page.component.scss'],
  providers: [AuthService]
})

export class SignupPageComponent {

  signUpForm : FormGroup;

  user: SocialUser;
  loggedIn: boolean;

  emailAlreadyExist: boolean = false;

  constructor(private router: Router, private authService: AuthService, private socialAuthService: SocialAuthService){
    this.signUpForm = new FormGroup({
      email: new FormControl('', [
        Validators.email,
        Validators.required
      ]),
      password: new FormControl(null, [
        Validators.required,
        Validators.minLength(6)
      ])
    });
  }

  submit(){
    this.authService.signUp(this.signUpForm.value.email, this.signUpForm.value.password).subscribe((responseData) => {
        console.log(responseData);
        localStorage.setItem('token', responseData.body.token);
        localStorage.setItem('refresh', responseData.body.refresh.token);
        localStorage.setItem('userId', responseData.body.userId);
        if (responseData.status == 200) {
          this.router.navigate(['/workspace']);
        }
      },
      error => {
      console.log(error);
        if (error.status == 409) {
          this.emailAlreadyExist = true;
        }
    });
  }

  goToLoginPage() {
    this.router.navigate(['/login']);
  }

  goToHomePage() {
    this.router.navigate(['/home']);
  }

  signupWithGoogle(): void {
    this.socialAuthService.signIn(GoogleLoginProvider.PROVIDER_ID)
      .then(() => {
        this.socialAuthService.authState.subscribe((user) => {
          this.user = user;
          this.loggedIn = (user != null);
          this.authService.googleSignUp(user.email, user.provider).subscribe((responseData) => {
              if (responseData.status == 200) {
                localStorage.setItem('token', responseData.body.token);
                localStorage.setItem('refresh', responseData.body.refresh.token);
                localStorage.setItem('userId', responseData.body.userId);
                this.router.navigate(['/workspace']);
              }
            },
            error => console.log(error));
        });
      });
  }

}
<header>
  <div class="container-xl mt-5">
    <div class="row justify-content-center">
      <div class="col-5 col-lg-2">
        <a (click)="goToHomePage()"><img src="assets/trello-logo-blue.svg" alt="trello-logo-blue"></a>
    </div>
    </div>
  </div>
</header>

<div class="content">
  <div class="container-xl mt-5">
    <div class="row justify-content-center">
        <div class="col-10 col-lg-5 form-container">
          <div class="row mt-4 mb-4">
            <span class="text-center">Sign up for your account</span>
          </div>
          <div class="row justify-content-center">
            <div class="col-lg-10">

          <form [formGroup]="signUpForm" novalidate (ngSubmit)="submit()">
            <div class="form-group">
              <input type="text" class="form-control" id="form-login" formControlName="email" placeholder="Enter email"/>

              <div class="alert alert-danger"
                   *ngIf="signUpForm.controls['email'].invalid && signUpForm.controls['email'].touched">
                Email not specified
              </div>
            </div>

            <div class="form-group mt-3">
              <input type="password" class="form-control" id="form-password" formControlName="password" placeholder="Enter password" />

              <div class="alert alert-danger"
                   *ngIf="signUpForm.controls['password'].invalid && signUpForm.controls['password'].touched">
                Password not specified
              </div>
              <div class="submit-data-error" *ngIf="emailAlreadyExist">This mail is already registered!</div>
            </div>

            <div class="form-group mt-4 mb-4 d-flex justify-content-center">
              <button class="btn btn-default btn btn-primary btn-lg btn-block" id="submit-button" [disabled]="signUpForm.invalid">
                Submit
              </button>
            </div>
          </form>

              <div class="row mb-4">
                <span class="text-center">OR</span>
              </div>

              <button type="button" (click)="signupWithGoogle()" id="google-auth-button"><img src="assets/google-logo.jpg" class="google-logo">Continue with Google</button>
              <hr class="break-line">
              <div class="row mb-4">
                <a (click)="goToLoginPage()" class="login-link">Already have an account? Log In</a>
              </div>

            </div>
          </div>
        </div>
    </div>
  </div>
</div>

<footer>
  <div class="container-xl mt-5">
      <div class="atlassian-logo">
        <img src="assets/atlassian-logo-blue-small.svg" alt="atlassian-logo">
      </div>
    </div>
    <div class="row justify-content-center">
      <div class="col-6 text-center mt-3">
        <h5>© Copyright 2021. All rights reserved.</h5>
      </div>
    </div>
</footer>

import { Component } from '@angular/core';
import {FormControl, FormGroup, Validators} from '@angular/forms'
import {Router} from "@angular/router";
import {AuthService} from "../../services/auth.service";
import { SocialAuthService } from "angularx-social-login";
import { GoogleLoginProvider } from "angularx-social-login";
import { SocialUser } from "angularx-social-login";
import {OnInit} from "@angular/core";

@Component({
  selector: 'app-login-page',
  templateUrl: './login-page.component.html',
  styleUrls: ['./login-page.component.scss'],
})
export class LoginPageComponent implements OnInit{

  signUpForm : FormGroup;

  user: SocialUser;
  loggedIn: boolean;

  incorrectEmailPassword: boolean = false;

  constructor(private router: Router, private authService: AuthService, private socialAuthService: SocialAuthService){
    this.signUpForm = new FormGroup({
      email: new FormControl('', [
        Validators.email,
        Validators.required
      ]),
      password: new FormControl(null, [
        Validators.required,
        Validators.minLength(6)
      ])
    });
  }
  ngOnInit(): void {

  }

  submit(){
    this.authService.logIn(this.signUpForm.value.email, this.signUpForm.value.password).subscribe( (responseData) => {

        if (responseData.status == 200) {
          localStorage.setItem('token', responseData.body.token);
          localStorage.setItem('refresh', responseData.body.refresh.token);
          localStorage.setItem('userId', responseData.body.userId);
        this.router.navigate(['/workspace']);
        }
      },
      error =>
      {
        console.log(error);
        if (error.status == 401) {
          this.incorrectEmailPassword = true;
        }
      });
  }

  goToHomePage() {
    this.router.navigate(['/home']);
  }

  goToSignUpPage() {
    this.router.navigate(['/signup']);
  }

  loginWithGoogle(): void {
    this.socialAuthService.signIn(GoogleLoginProvider.PROVIDER_ID)
      .then(() => {
        this.socialAuthService.authState.subscribe((user) => {
          this.user = user;
          this.loggedIn = (user != null);
          this.authService.googleSignUp(user.email, user.provider).subscribe((responseData) => {
              if (responseData.status == 200) {
                localStorage.setItem('token', responseData.body.token);
                localStorage.setItem('refresh', responseData.body.refresh.token);
                localStorage.setItem('userId', responseData.body.userId);
                this.router.navigate(['/workspace']);
              }
            },
            error => console.log(error));
        });
      });
  }

}
